  true,\n\t\"url\": null,\n\t\"notes\": \"For a Fairfax County police officer-involved
  shooting where deadly force has been utilized or for a private individual who utilizes
  deadly force, the criminal investigation is conducted by detectives from the Criminal
  Investigation Bureau. The criminal investigation is forwarded to the Office of the
  Commonwealthu2019s Attorney for Fairfax County for a determination of criminal liability.
  For further information on officer-involved shootings, please refer to http://www.fairfaxcounty.gov/police/inside-fcpd/063015ois.htm.Each
  event is represented here as the Roadway Line Segment that represents the one hundred
  block that the event was reported to have occurred within.Updates will be made as
  soon as possible.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
